import { Navbar } from 'react-bootstrap';
import './App.css';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";
import Home from './components/Home';
import About from './components/About';


function App() {
  return (
    <>
    <Router>
    <Navbar/>
    <Home>
    <Switch>
    <Route path="/">
            <Home />
          </Route>
          <Route exact path="/about">
           <About />
          </Route>
        </Switch>

    </Home>
    </Router>
    </>

  );
}

export default App;
